      s_t14: this.state.s_t14,
      s_t15: this.state.s_t15,
      s_t16: this.state.s_t16,
      s_t17: this.state.s_t17,
      s_t18: this.state.s_t18,
      s_t19: this.state.s_t19,
      s_t20: this.state.s_t20,
      s_t21: this.state.s_t21,
      s_t22: this.state.s_t22,
      s_t23: this.state.s_t23,
      s_t24: this.state.s_t24,
      s_t25: this.state.s_t25,
      s_t26: this.state.s_t26,
      s_t27: this.state.s_t27,
      s_t28: this.state.s_t28,
      s_t29: this.state.s_t29,
      s_t30: this.state.s_t30,
      s_t31: this.state.s_t31,
      s_t32: this.state.s_t32,
      s_t33: this.state.s_t33,
      s_t34: this.state.s_t34,
      s_t35: this.state.s_t35,
      s_t36: this.state.s_t36,
      s_t37: this.state.s_t37,
      s_t38: this.state.s_t38,
      s_t39: this.state.s_t39,
      s_t40: this.state.s_t40,
      s_t41: this.state.s_t41,
      s_t42: this.state.s_t42,
      s_t43: this.state.s_t43,
      s_t44: this.state.s_t44,
      s_t45: this.state.s_t45,
      s_t46: this.state.s_t46,
      s_t47: this.state.s_t47,
      s_t48: this.state.s_t48,
      s_t50 : this.state.s_t50,
      type: type
      }
      this.openModal();
        this.setState({
          btnstatus : true
        })
      console.log("body here", body);
      try {
        const response = await axios.post(
          `${API_URL}rf_form/submit`,
         body,
          (axios.defaults.headers.common["x-access-token"] = tokenvalue)
        );
        console.log(response);
        //   .then(console.log(this.state));


        if (response.data==='success') {
          // alert(response.data);




          this.props.history.push("/ViewParticleSize");

        } else {
          alert(response.data);
        }
      } catch (error) {
        console.log(error);
      }
    } else {
      this.validator.showMessages();
      // rerender to show messages for the first time
      this.forceUpdate();
    }

  }

