// console.log('newtotalpane', +this.state.s_t50.toString())
      //  new_total_pan = this.state.total_pan;
      // }
      this.state.s_t2 = +this.state.s_t1;
      this.state.s_t6 = +this.state.s_t1 + +this.state.s_t5;
      this.state.s_t10 = +this.state.s_t9 + +this.state.s_t6;
      this.state.s_t14 = +this.state.s_t13 + +this.state.s_t10;
      this.state.s_t18 = +this.state.s_t17 + +this.state.s_t14;
